import PropTypes from 'prop-types';

export function FilmCard({ id, title }) {
  //   console.log(typeof film);
  return (
    <>
      <li>{id}</li>
      <li>{title}</li>
    </>
  );
}
FilmCard.propTypes = {
  id: PropTypes.number,
  title: PropTypes.string,
};
